package Collections;

import java.util.HashSet;

public class HashS {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet<String> set = new HashSet<>();
		set.add("apple");
		set.add("orange");
		set.add("grapes");
		System.out.println("The elements are: " + set);

	}

}
